int main()
{
	int len = sizeof(mat)/sizeof(char *);

	std::cout << "Dancing Links Start " << std::endl;
	clock_t t1 = clock();
	hxl::Dlx logic(mat, len);
	clock_t t2 = clock();
	std::cout << "Dancing Links ctor: " <<  t2-t1 << "ms" << std::endl;
	logic.Dance();
	clock_t t3 = clock();
	std::cout << "Dancing Links Dance: " <<  t3-t2 << "ms" << std::endl;
	std::vector<std::set<int> > res = logic.GetRes();

	std::for_each(res.begin(), res.end(), [&](std::set<int> s) {
		std::ostringstream oss;
		oss << "{ ";
		std::for_each(s.begin(), s.end(), [&oss](int v) {
			oss << v << " ";
		}); 
		oss << "}\n";
		std::cout << oss.str();
	});

	return 0;
}


